import ExpenseItem from "./ExpenseItem";
import styles from "./Expense.module.css"

const Expense = props =>{
    return(
        <div className={styles.expenses}>
            {props.userData.map((expense)=>
                <ExpenseItem 
                    name ={props.userData.userName} 
                    age = {props.userData.age}>
                </ExpenseItem>
            )}

        </div>
    )
}

export default Expense;
